const Featured = (props) => {
  const teacher= props.match.params.name;
  return (
    <div className="main-content">
      <h2>{teacher} </h2>
      <p>Introducing <strong>{teacher}</strong>, a teacher who loves teaching courses about <strong></strong>!</p>
    </div>
  );
}

export default Featured;
